import React, { useState } from 'react';

function generateCards(props) {
    console.log('called');

    return(
            props.item.map((item, i) => {
                return (
                    <ModuleCard
                        id={"card_" + i}
                        className="card"
                        title={item}>
                    </ModuleCard>
                )
            })

    )

}

export default generateCards;
